,"list-suffix":function(internalc,box) {
		box.element.className += ' postRender';
		/***************HEADER************/
        if (box.custom_header_box) {
                while (box.header.firstChild.firstChild)
                        box.header.firstChild.removeChild(box.header.firstChild.firstChild);
                box.drawPager();
        } else {
                box.custom_header_box = document.createElement('h3');
                //box.custom_header_box.setAttribute('id','header_wrapper');
                box.custom_header_box.appendChild(box.header.lastChild);
        }
        box.header.firstChild.appendChild(box.custom_header_box);
        box.element.lastChild.setAttribute('id','wrapper_ft');
        
       /****************First Item************/
        var first = internalc.removeChild(internalc.firstChild);
        first.className +=' trc_first_recommendation';
        var first_img = first.getElementsByTagName('img')[0];
        if(typeof first_img != 'undefined'){
            var src = box.getThumbnailURL(first.video_data,280,157);
            var parent = first_img.parentNode;
            parent.removeChild(first_img);
            var new_img = document.createElement('img');
            new_img.style.visibility = 'hidden';
            new_img.onload = function(){
                var self = this;
                if(this.complete)
                    box.FixVideoImage(286,156, this);
                else
                    window.setTimeout(function(){box.FixVideoImage(286,163, self);},1000);
            };
            new_img.src = src;
        }
        internalc.parentNode.parentNode.insertBefore(first,internalc.parentNode.parentNode.firstChild);
        first.video_data.link.firstChild.firstChild.innerHTML = first.video_data.title;
        first.fixTextOverflow(true);
        parent.appendChild(new_img);
        /**********END OF FIRST ITEM **********/

/**** 
		this part of code adds a new title for the last row
****/
	for(var i= 1; i < box.boxes.length; i++) {
		if(i == 4) {
			
			var header = box.header.cloneNode(true);
			if(header){
				var clearDiv = document.createElement('div');
				if(document.getElementsByClassName('trc_pager').length > 0) {
					header.firstChild.removeChild(header.firstChild.firstChild);
				}
				header.firstChild.firstChild.firstChild.innerHTML = 'From Around the Web';
				clearDiv.style.clear = 'both';
				box.boxes[i].parentNode.insertBefore(clearDiv,box.boxes[i]);
				header.className +=' syndicated_header';
				box.boxes[i].parentNode.insertBefore(header,box.boxes[i]);
			}
		}
/** END **/

		if(i%3==1) {
			box.boxes[i].className +=' firstInRow';
		}
	}
	
}
